import { Col, Container, Row } from "react-bootstrap"

function Login()
{
    return(
        <div>
            <Container fluid>
                <Row>
                    <Col className="justify-content-center">
                        <h1>Login Page</h1>
                    </Col>
                </Row>
            </Container> 
        </div>
    )
}

export default Login
